import java.util.*;
import java.util.stream.*;
import java.io.*;

public class Solution {
	public static BufferedReader br = new BufferedReader(new InputStreamReader(System.in));
	public static StringTokenizer st;

	public static class Node{
		int val;
		Node left;
		Node right;
		Node parent;
		public Node() {}
		public Node(int val) {
			this.val = val;
		}
		
		public void setVal(int val) {
			this.val = val;
		}

		public void addChild(Node node) {
			if(this.left == null) this.left = node;
			else				  this.right = node;
		}
		public void setParent(Node node) {
			this.parent = node;
		}
		@Override
		public String toString() {
			return "Node [val=" + val + ", \nleft=" + (left != null? left.val : null ) + ", \nright=" + (right != null? right.val : null ) + ", \nparent=" + (parent != null? parent.val : null ) + "]";
		}
	}
	
	public static void main(String[] args) throws IOException{
		int T = Integer.parseInt(br.readLine());

		for(int t = 1 ; t <= T; t++) {
			st = new StringTokenizer(br.readLine());
			
			int N = Integer.parseInt(st.nextToken());
			int E = Integer.parseInt(st.nextToken());
			int A = Integer.parseInt(st.nextToken());
			int B = Integer.parseInt(st.nextToken());
			
			
			Map<Integer, Node> memo = new HashMap<>();
					
			for(int x = 1 ; x <= N; x++) memo.put(x, new Node(x));
			
			
			st = new StringTokenizer(br.readLine());
			for(int i = 1; i <= E; i++) {
				Node parent = memo.get(Integer.parseInt(st.nextToken()));
				Node child = memo.get(Integer.parseInt(st.nextToken()));
				
				parent.addChild(child);
				child.setParent(parent);
			}
			
			int commonMax = getMaxCommon(memo.get(A),memo.get(B));
			int childeCount = getChildCount(memo.get(commonMax));
			System.out.printf("#%d %d %d\n",t,commonMax,childeCount);
		}
	}
	public static int getMaxCommon(Node A, Node B) {
		ArrayList<Integer> AParents = getParents(A);
		ArrayList<Integer> BParents = getParents(B);
		
		ArrayList<Integer> common = new ArrayList<>();
		
		for(int n : AParents) {
			if(BParents.contains(n)) {
				common.add(n);
			}
		}
		
		return common.get(0);
	}
	public static ArrayList<Integer> getParents(Node node){
		ArrayList<Integer> result = new ArrayList<>();
		Node temp = node;
		
		while(temp.parent !=null) {
			result.add(temp.parent.val);
			temp = temp.parent;
		}
		
		return result;
	}
	public static int getChildCount(Node node){
		int result = 1;
		
		if(node.left != null) {
			result += getChildCount(node.left);
		}
		if(node.right != null) {
			result += getChildCount(node.right);
		}
		
		return result;
	}
}

